description:
Welcome to the 5th annual BikeFest Tour of the Valley. 

Come out and enjoy the stunning fall foliage, dairy farms, and quaint villages of the Pioneer Valley, the heart of New England cycling. 

Tour of the Valley entrance fee includes supported ride, a gourmet BBQ lunch buffet with local craft beers, entertainment featuring the music  of the Art Steele band a pro BMX stunt show from Team East. The first 150 registrants get collector’s edition high quality BikeFest T-Shirt &#x28;century and metric century only.&#x29;
